import '../CSS/Tasks.css';
import { Container, Row, Col } from 'react-bootstrap';
import { Translate } from '@material-ui/icons';


function Tasks() {
    return (
        <div>
            <Container fluid="md">
                <Col style = {{background:"green"}}>
                    1 of 4
                </Col>
                <Col>
                    2 of 4
                </Col>
                <Col>
                    3 of 4
                </Col>
                <Col>
                    4 of 4
                </Col>

            </Container>
        </div >
    );
}


export default Tasks;
